### Summary of Core Topics and Concepts

#### 1. **Multi-Armed Bandits**
- **Concepts**: ε-greedy policy, reward distribution, stationary vs. non-stationary environments.
- **Equations**:
  - ε-greedy policy: \( P(a) = \begin{cases}
1 - \epsilon + \frac{\epsilon}{k} & \text{if } a = \text{argmax } Q_t(a) \\
\frac{\epsilon}{k} & \text{otherwise}
\end{cases} \)
  - Average reward: \( Q_t(a) = \frac{\text{Total reward for action } a}{\text{Number of times action } a \text{ was selected}} \)

#### 2. **Markov Decision Processes (MDPs)**
- **Concepts**: States, actions, transition probabilities, rewards, discount factor (γ), value functions, Bellman equations.
- **Equations**:
  - Bellman equation for state value function: \( v_{\pi}(s) = \sum_a \pi(a|s) \sum_{s'} \sum_r p(s', r | s, a) [r + \gamma v_{\pi}(s')] \)
  - Bellman equation for action value function: \( q_{\pi}(s, a) = \sum_{s'} \sum_r p(s', r | s, a) [r + \gamma v_{\pi}(s')] \)
  - Expected return: \( G_t = R_{t+1} + \gamma R_{t+2} + \gamma^2 R_{t+3} + \cdots \)

#### 3. **Value Iteration**
- **Concepts**: Value function updates, synchronous updates, policy evaluation, policy improvement.
- **Equations**:
  - Value iteration update: \( v(s) \leftarrow \max_a \sum_{s'} p(s' | s, a) [r(s, a, s') + \gamma v(s')] \)

#### 4. **Grid World Problems**
- **Concepts**: Deterministic transitions, terminal states, obstacles, optimal policy, state and action value functions.
- **Equations**:
  - State value function: \( v_{\pi}(s) \)
  - Action value function: \( q_{\pi}(s, a) \)

